import Contenu from "./components/Contenu";
import Button from 'react-bootstrap/Button';

function App() {

  const [profile, setProfile] = useState([])

  useEffect(()=>{
    fetch("http://localhost:3000/profile")
      .then(res => res.json())
      .then(data => setProfile(curr => curr))
  },[])

  console.log(profile)

  return (
    <div className="m-2">
      <Button variant={"danger"}>Cacher les donn√©es</Button>
      {
        profile.map(data => (
          <div>
            <Contenu 
              data={data}
            />
            <hr />
          </div>
        ))
      }
    </div>
  );
}

export default App;
